import { get, post } from './http'; // 获取表单数据

export function getDataDetails(params) {
  return get('/formData/detail', params);
} // 属性分组预览（数据）

export function getFormGroupDetail(params) {
  return get('/model/data/page/group', params);
} // 查询单个模型

export function getModelByCode(params) {
  return get('/model/getByCode', params);
} // 新增数据（DE）

export function createForDE(params) {
  return post('/formData/createForDE', params);
} // 获取表格数据（DE）

export function getTableDynamic(params) {
  return get('/v1/model/customform/config', params);
}